import React from "react"
import { Grid, Cell } from "react-mdl"

class About extends React.Component {
    render() {
        return (
            <Grid>
                <Cell col={3}>
                    Left Col
                </Cell>

                <Cell col={6}>
                    Middle Col
                </Cell>

                <Cell col={3}>
                    Right Col
                </Cell>
            </Grid>
        )
    }
}

export default About
